import React from 'react'
import PropTypes from 'prop-types';

const PostImages = ({ images }) => {
  if(images.length === 1 ){
    return (
      <>
      {/* alt 시각장애인들을 위한 힌트 */}
        <img  />
        
      </>
    )
  }
  return (
    <div></div>
  )
};

PostImages.propTypes = {
  images : PropTypes.arrayOf(PropTypes.object),
}

export default PostImages
